import React, { } from 'react';
import './FullPanel.css';
import { motion, useScroll } from 'framer-motion';

const FullPanel1 = () => {
  return (
    <div id="content" className="content">
      <h1 className="title">Using tikz in org</h1>

      {/* Table of Contents */}
      <div id="table-of-contents" role="doc-toc">
        <h2>Table of Contents</h2>
        <div id="text-table-of-contents" role="doc-toc">
          <ul>
            {/* Table of Contents items */}
            <li><a href="#orgcc7d50f">1. Haskell basics</a></li>
            <li><a href="#org48e4310">2. My Category Theory Diagram</a></li>
            <li><a href="#org809995d">3. Direct Sum Universal Property</a></li>
            <li><a href="#orga1a13d0">4. Using a tikz picture</a></li>
          </ul>
        </div>
      </div>

      {/* Content Sections */}
      {/* Section 1: Haskell basics */}
      <div id="outline-container-orgcc7d50f" className="outline-2">
        <h2 id="orgcc7d50f">1. Haskell basics</h2>
        {/* Content for Haskell basics */}
      </div>

      {/* Section 2: My Category Theory Diagram */}
      <div id="outline-container-org48e4310" className="outline-2">
        <h2 id="org48e4310">2. My Category Theory Diagram</h2>
        {/* Content for Category Theory Diagram */}
      </div>

      {/* Section 3: Direct Sum Universal Property */}
      <div id="outline-container-org809995d" className="outline-2">
        <h2 id="org809995d">3. Direct Sum Universal Property</h2>
        {/* Content for Direct Sum Universal Property */}
      </div>

      {/* Section 4: Using a tikz picture */}
      <div id="outline-container-orga1a13d0" className="outline-2">
        <h2 id="orga1a13d0">4. Using a tikz picture</h2>
        {/* Content for Using a tikz picture */}
      </div>
    </div>
  );
};

export default FullPanel1;
